script: |
  super -f text -I q13462.spq | sort > q13462.out

inputs:
  - name: q13462.spq
    data: |
      SELECT ALL + - col2, col2 * - col1 FROM tab0 (FORMAT parquet) AS cor0 WHERE col2 BETWEEN + - col0 * + + col2 * + col0 * + ( - 26 ) AND + 18 / col2 * 96 + + col2;
  - name: tab0

outputs:
  - name: q13462.out
    data: |
